    false,nt"url": null,nt"notes": "This annual narrative report for Lacreek
    National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    public participation and compliance with environmental and cultural resource mandates.
    Refuge administration is outlined; information about personnel, youth programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
    management, pest control, and water rights. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife propagation,
    animal control, marking and bird banding, and disease control. The public uses of
    the Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and energy conservation. Cooperative programs and items of interest are
    provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
